import { View, Text, StyleSheet } from "react-native";
const Home = () => {
  return (
    <View style={styled.homeContainer}>
      <View style={styled.headerContainer}>
        <Text style={styled.homeHeader}>Welcome to hell</Text>
      </View>
      <View>
        <Text style={styled.textContainer}>
          Providing you with information about 30 demons. Here you will find all
          the information about them, as well as the way to summon them
        </Text>
        <Text style={[styled.homeText,styled.homeCommit]}>Be careful. They can hear you.</Text>
      </View>
    </View>
  );
};

const styled = StyleSheet.create({
  homeContainer: {
    alignItems:'center'
  },
  headerContainer:{
    marginBottom:'auto'
  },
  homeHeader: {
    fontSize: 64,
    color: "#f0c4a8",
    fontFamily: "BeastText"
  },
  homeText: {
    fontSize: 24,
    color: "#f0c4a8",
    fontFamily: "RalewayText",
    textAlign:'center'
  },
  textContainer:{

  },
  homeCommit:{
    fontSize: 18,
  }
});

export default Home;
